import React, { Component } from 'react'
// import { tsImportEqualsDeclaration } from '@babel/types';
// import Imga from "../images/1.jpg"

export default class Studentpprofile extends Component {
    constructor(props) {
        super(props)

        this.state = {
            name: "",
            age: "",
            uni: "",
            college: "",
            subjects: ""

        };
    };

    handlechange = (event) => {
        this.setState({
            [event.target.name]: event.target.value,


        })
    }
    handlesubmit = (e) => {
        console.log(this.state.name, this.state.age, this.state.uni, this.state.college, this.state.subjects)
        e.preventDefault();
    }

    render() {
        return (
            <div>
                <div className="studentprofile">
                    <br />
                    <div className="stddiv">
                        <label><h2>students details</h2></label>
                        <form onSubmit={this.handlesubmit.bind(this)}>
                            <input type="text"
                                name="name"
                                placeholder="fullname"
                                value={this.state.name}
                                onChange={this.handlechange.bind(this)} />
                            <br />

                            <input
                                type="text"
                                name="age"
                                placeholder="age"
                                value={this.state.age}
                                onChange={this.handlechange.bind(this)} />
                            <br />

                            <input type="text"
                                name="uni"
                                placeholder="university"
                                value={this.state.uni}
                                onChange={this.handlechange.bind(this)} />
                            <br />

                            <input type="text"
                                name="college"
                                placeholder="college"
                                value={this.state.college}
                                onChange={this.handlechange.bind(this)} />
                            <br />

                            <input type="text"
                                name="subjects"
                                placeholder="subjects"
                                value={this.state.subjects}
                                onChange={this.handlechange.bind(this)} />
                            <br />




                            <input type="submit" value="Login"></input>


                        </form>

                    </div>

                </div>

                
                   {/* <div className="datashow">
                   <p>{this.state.name}</p>
                    <p>{this.state.age}</p>
                    <p>{this.state.uni}</p>
                    <p>{this.state.college}</p>
                    <p>{this.state.subjects}</p>
                   </div> */}
            
            </div>
        )
    }
}
